import React from 'react';
import logo from './logo.svg';
import './App.css';

interface IRecipe {
  name: string,
  price: number,
  img: string,
  recipyDesctiption: string
}

let recipes: IRecipe[] = [{
    name: "Borch",
    price: 10,
    img: "https://gotovim-doma.ru/images/recipe/0/0a/00ad9d3b1ff86a92ce5935bc47a1bdee_l.jpg",
  recipyDesctiption: "Borch description"
  }, {
    name: "Fish",
    price: 20,
    img: "data:image/jpeg;base64,",
  recipyDesctiption: "Fish description"
  }];

function makeRecipe(recipe: IRecipe) {
  return (
      <div>
  <div> {recipe.name}</div>
   <img src={recipe.img}/>
  <div> {recipe.recipyDesctiption}</div>
      </div>
  )
}

const App: React.FC = () => {
  return (
    <div className="App">
    <header className="App-header">


     <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.tsx</code> and save to reload
        </p>
       <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
